import { Fragment } from 'react';
const Navigation = () =>(
    <Fragment>
        <div className='navigation-container'>
            <div className='nav-logo'>
            </div>
            <div className='nav-links-cintainer'>
                <Link className = 'nav-link' to ='/shop'>shop</Link>
            </div>
                <Outlet/>
        </div>
    </Fragment>
)

export default Navigation;
